import React, { Fragment } from 'react';

const Register = () => {
  return <Fragment>
    <h1 className="large text-primary">Sign Up</h1>
    <p className="lead"><i className="fas fa-user"></i>Create Your Account</p>
    <form className="form" action></form>
  </Fragment>;
};

export default Register;
